import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import ConsentPage from './ConsentPage';
import HomePage from './HomePage';
import DemographicPage from './DemographicPage';
import Instructions from './Instructions';
import Experiment from './Experiment';
import SliderPage from './SliderPage';
import ThankYouPage from './ThankYouPage';
import Description from './Description';
import { RandomIdProvider } from './RandomIdContext'; // Import the RandomIdProvider

function App() {
  return (
    <RandomIdProvider> {/* Wrap the Router with RandomIdProvider */}
      <Router>
        <div className="App">
          <header className="App-header">
            <Routes>
              <Route path="/" element={<HomePage />} />
              <Route path="/consent" element={<ConsentPage />} />
              <Route path="/demographic" element={<DemographicPage />} />
              <Route path="/instructions" element={<Instructions />} />
              <Route path="/experiment" element={<Experiment />} />
              <Route path="/sliders" element={<SliderPage />} />
              <Route path="/thankyou" element={<ThankYouPage />} />
              <Route path="/description" element={<Description />} />
            </Routes>
          </header>
        </div>
      </Router>
    </RandomIdProvider>
  );
}

export default App;
